import React, {Component} from 'react'

import './header.scss'

class Header extends Component {
    render() {
        return (
            <header className='header'>
                <button className='back'>
                    返回
                </button>
                <span className='title'>{this.props.title}</span>
            </header>
        )
    }
}

export default Header
